  false,\n\t\"url\": null,\n\t\"notes\": \"A geodatabase containing the boundaries
  of semipermanently flooded wetlands sampled on 8 National Wildlife Refuges in 2014
  and 2015.   These stations are located in the western Prairie Pothole Region Bowdoin
  and Medicine Lake NWRs and Intermountain West Bear Lake, Camas, Fish Springs, Grays
  Lake, Lee Metcalf, and Malheur NWRs.  This geodatabase constitutes the sampling
  frame for the project.   Each station was considered a distinct geographic strata.
  Within each station multiple management units were selected nonrandomly by participating
  stations, with a spatiallybalanced random selection of points selected for wetland
  vegetation surveys.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
